import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import useAuthentication from '../actions/auth';
import TaskID from './Takimet/takimiByID';
import { getTakmiById } from '../actions/TakimetActions';

function TakimiByIdList() {
    const dispatch = useDispatch();
    const userId = localStorage.getItem('userId');

    useEffect(() => {
        dispatch(getTakmiById(userId));
    }, [dispatch, userId]);

    const { user, meetings } = useSelector(state => state.userReducerContent);

    const isAuthenticated = useAuthentication();

    if (isAuthenticated === null) {
        return <p>Loading...</p>;
    }

    if (isAuthenticated === false) {
        return window.location.href = "/";
    }

    const renderMeetings = (meetings) => {
        if (Array.isArray(meetings)) {
            return (
                <div className='container'>
                    <hr></hr>
                    <div className='row'>
                        <div className='col-md-4'>
                            <div className='card text-center'>
                                <div className='card-header bg-primary text-white'>
                                    <h3>INPUT QUEUE</h3>
                                    <div className='card-body'>
                                        {meetings.map((task) => (<TaskID key={task.id} repartiId={task.employee.reparti.id} mjketId={task.employee.id} userId={user.id} task={task} />))}
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            );
        } else {
            console.log("meetings nuk është një array.");
            // Veprimet e nevojshme për të trajtuar rastin kur meetings nuk është një array
            return null;
        }
    };

    return (
        <div>
            <h1>Specializimi i Mjekut</h1>
            {renderMeetings(meetings)}
        </div>
    );
}

export default TakimiByIdList;
